import "./stylesheets/App.css";
import { Testimony } from "./components/Testimony";

function App() {
  return (
    <React.Fragment>
      <h1>
        Esto es lo que dicen nuestros alumnos sobre
        FreeCodeCamp:
      </h1>
      <main className="main">
        <Testimony
          name="Shawn Wang"
          country="Singapur"
          image="shawn"
          job-title="Ingeniero de Software"
          company="Amazon"
          comment=""
        ></Testimony>
      </main>
    </React.Fragment>
  );
}

export default App;
